def ba1b(dna_string, k_mer):
    first_kmer = dna_string[:k_mer]
    my_dict = {}
    my_dict[first_kmer] = 1
    for i in range(len(dna_string) - k_mer + 1):
        a = dna_string[i:i+k_mer]
        if a in my_dict:
            my_dict[a] += 1
        else:
            my_dict[a] = 1
    
    max_val = max(my_dict.values())
    for key in my_dict:
        if my_dict[key] == max_val:
            print(key)




def ba1c(pattern):
    reverse_complement = ''
    for i in range(len(pattern)-1, -1, -1):
        if pattern[i] == 'A':
            reverse_complement += 'T'
        elif pattern[i] == 'C':
            reverse_complement += 'G' 
        elif pattern[i] == 'G':
            reverse_complement += 'C'         
        else:
            reverse_complement += 'A'

    print(reverse_complement)



